import React, { Component } from 'react';
import axios from 'axios';

export default class PdfButton extends Component{

   state = {pdf};

goPdf(pdf){
    axios.get('/create-pdf').
    then(response =>{
         pdf = response.data;
    })
}


render(){
    return (
         <div>
<button className ="buton" onclick = {this.goPdf}>Load PDF</button>
<div className="pdf-preview">
<Document file= {this.state} onLoadSuccess={this.onDocumentLoadSuccess}>
    <Page pageNumber={1}></Page>
   </Document>
</div>
         </div>
    );  
}

}
